          <h2>Biz Kimiz?</h2>
          <div className="team-member">
            <img src={team1} alt="Ayşenur Konar" />
            <h3>Ayşenur Konar</h3>
            <p>Kurucu</p>
          </div>
        </div>

        <div className="about-text">
          <h2>Hakkımızda</h2>
          <p>
          </p>
        </div>
      </div>
    </section>
  );
};

export default Aboutus;
